    let expectedObj2 = { headers: { "Authorization": "Bearer yyy",'X-country': 'CL', 'X-chRef': "1", 'X-commerce': "1", 'X-rhsRef': "1", 'X-cmRef': "1", 'X-txRef': "1", 'X-prRef': "1", 'X-usrTx': "MassiveLoader" }};
